import React from "react";
import "./App.css";
import WorkoutCard from "./WorkoutCard"


function WorkoutList ( { selectedAthlete, onLogSubmit, workouts, onLogDelete } ) {

    console.log(selectedAthlete)

    const sortWorkoutByDate = workouts.sort((a, b) => a > b ? 1 : a < b ? -1 : 0 )

    const filterWorkoutByAthlete = sortWorkoutByDate.filter((workout) => {
        if (selectedAthlete === "All") {
            return true
        } else if (workout.log_entries.find((entry) => entry.athlete_id === selectedAthlete.id)) {
            return workout
        } else {
            return false
        }
    })

    const workoutsToDisplay = filterWorkoutByAthlete.map((workout) => <WorkoutCard onLogSubmit={onLogSubmit} key={workout.id} workout={workout} selectedAthlete={selectedAthlete} onLogDelete={onLogDelete}/>)

    return (
        <div id="workout_list">
            {workoutsToDisplay}
            {/* {selectedAthlete === "All" ? workoutsToDisplay(workouts) : workoutsToDisplay(selectedAthlete.workouts)} */}
        </div>
    )
}

export default WorkoutList
